def create_sty_files(tex_dir:Path):

    moderncvcls = ModernCVClsFile()
    moderncvcls.create(tex_dir)

    blacksty = ModernCVColorBlackStyFile()
    blacksty.create(tex_dir)

    bluesty = ModernCVColorBlueStyFile()
    bluesty.create(tex_dir)

    purplesty = ModernCVColorPurpleStyFile()
    purplesty.create(tex_dir)

    greysty = ModernCVColorGreyStyFile()
    greysty.create(tex_dir)

    greensty = ModernCVColorGreenStyFile()
    greensty.create(tex_dir)

    orangesty = ModernCVColorOrangeStyFile()
    orangesty.create(tex_dir)

    redsty = ModernCVColorRedStyFile()
    redsty.create(tex_dir)

    compatibilitysty = ModernCVCompatibilityStyFile()
    compatibilitysty.create(tex_dir)

    bankingsty = ModernCVStyleBankingStyFile()
    bankingsty.create(tex_dir)

    casualsty = ModernCVStyleCasualStyFile()
    casualsty.create(tex_dir)

    classicsty = ModernCVStyleClassicStyFile()
    classicsty.create(tex_dir)

    emptysty = ModernCVStyleEmptyStyFile()
    emptysty.create(tex_dir)

    oldsty = ModernCVStyleOldStyFile()
    oldsty.create(tex_dir)

    tweaksty = TweakListStyFile()
    tweaksty.create(tex_dir)



def setup_tex_dir(tex_dir:Path, cvObj:CurriculumVitae):

    if not tex_dir.exists():
        tex_dir.mkdir()

    # Create `cv.tex`
    cvObj.create(path=tex_dir)

    # Create `.sty` and `.cls` files
    create_sty_files(tex_dir)

    # Create `indra.JPG`
    decoded_data = base64.b64decode(INDRAJIT_PIC)
    with open(tex_dir / "indra.JPG", "wb") as f:
        f.write(decoded_data)


