def read_config():
    config = configparser.ConfigParser()

    config.read('config.ini')

    print(config['DOCUMENT_SETTINGS']['document_style'])

def check_none(item):
    return None if item == '' else item


def get_cvObject_from_config(_config_file:Path=Path.cwd() / 'config.yml'):

    with open(_config_file, 'r') as f:
        config = yaml.safe_load(f)

    
    firstName = check_none(config['FIRST_NAME'])
    familyName = check_none(config['FAMILY_NAME'])
    _address = [config['ADDRESS_LINE_1'], config['ADDRESS_LINE_2']]
    mob = check_none(config['MOBILE'])
    _email = check_none(config['EMAIL'])
    photo_filename = check_none(config['PHOTO_FILENAME'])
    if photo_filename:
        if photo_filename != 'indra.JPG':
            # TODO: Check whether it exsts or not.
            pass
  
    doc_style = check_none(config['THEME'])
    doc_color = check_none(config['THEME'])
    _font_size = check_none(config['FONT_SIZE'])
    _font_size = int(_font_size) if _font_size is not None else _font_size
    _paper_size = check_none(config['PAPER_SIZE'])
    _fontfamily = check_none(config['FONT_FAMILY'])
    _photo_height = check_none(config['PHOTO_HEIGHT'])
    _photo_height = float(_photo_height) if _photo_height is not None else _photo_height
    _photo_thickness = check_none(config['PHOTO_THICKNESS'])
    _photo_thickness = float(_photo_thickness) if _photo_thickness is not None else _photo_thickness


    # TODO: Complete it
    cv = CurriculumVitae(
        first_name=firstName,
        family_name=familyName,
        address=_address,
        mobile=mob,
        email=_email,
        photo=photo_filename,
        style=doc_style,
        color=doc_color,
        font_size=_font_size,
        font_family=_fontfamily,
        paper_size=_paper_size,
        photo_height=_photo_height,
        photo_thickness=_photo_thickness
    )


    # TODO: Use a `config.py` file to generate everythings below

    # Education
    cv.add_section(title="Education")
    _edu = config['EDUCATION']

    for degree in _edu:
        _years = degree['years']
        _name = degree['name']
        _inst = degree['institution']
        _country = degree['country']
        _grade = degree['grade']
        _description = check_none(degree['description'])
        if _description:
            if isinstance(_description, list):
                _description = r'\\'.join(_description)
        
        cv.add_cventry(
            years=_years,
            degree_or_job_title=_name,
            institution_or_employer=_inst,
            localization=_country,
            grade=_grade,
            description=check_none(_description)
        )


    # Internships
    cv.add_section(title="Internships")
    _intern = config['EDUCATION']

    for degree in _intern:
        _years = degree['years']
        _name = degree['name']
        _inst = degree['institution']
        _description = check_none(degree['description'])
        if _description:
            if isinstance(_description, list):
                _description = r'\\'.join(_description)
        
        cv.add_cventry(
            years=_years,
            degree_or_job_title=_name,
            institution_or_employer=_inst,
            description=_description
        )

    # Projects
    cv.add_section(title="Projects")
    _projects = config['PROJECTS']

    for degree in _projects:
        _years = degree['years']
        _name = degree['name']
        _inst = degree['institution']
        _description = check_none(degree['description'])

        if _description:
            if isinstance(_description, list):
                _description = r'\\'.join(_description)
        
        cv.add_cventry(
            years=_years,
            degree_or_job_title=_name,
            institution_or_employer=_inst,
            description=_description
        )


    # Skills
    cv.add_section(title="Skills")
    programming = check_none(config['PROGRAMMING_LANGUAGE'])
    if programming:
        cv.add_cvitem(header="Programming Language", text=programming)

    envn = check_none(config['ENVIRONMENT'])
    if envn:
        cv.add_cvitem(header="Environment", text=envn)
    
    os = check_none(config['OS'])
    if os:
        cv.add_cvitem(header="Operating System", text=os)

    print(cv.text)

    return cv


def make_cv():
    TEX_DIR = Path(__file__).parent.resolve() / "tex_dir"

    # Create cv
    # cv = get_cvObject(
    #     photo_height=70
    # )
    cv = get_cvObject_from_config()
    setup_tex_dir(tex_dir=TEX_DIR, cvObj=cv)

    # Change the dir
    os.chdir(str(TEX_DIR))

    # Compile cv.tex
    os.system("pdflatex cv.tex")

    # Open cv.pdf
    pdfpath = str(TEX_DIR / "cv.pdf")
    if sys.platform.startswith('linux'):
        os.system(f"xdg-open {pdfpath}")
    else:
        os.startfile(pdfpath)


